// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './pages/Home';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Dashboard from './pages/Dashboard';
import TravellerListening from './pages/TravellerListening';
import Hire from './pages/Hire';
import Booking from './pages/Booking';
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/login" component={Login} />
          <Route path="/signup" component={Signup} />
          <ProtectedRoute path="/dashboard" component={Dashboard} />
          <ProtectedRoute path="/traveller-listening" component={TravellerListening} />
          <ProtectedRoute path="/hire" component={Hire} />
          <ProtectedRoute path="/booking" component={Booking} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
